<style>
body {
    margin:0;
    height:100vh;
    display:flex;

    overflow:hidden;
}

.gift-box {
    width:200px;
    height:200px;
    background:#ff5e7e;
    border-radius:20px;
    position:relative;
    cursor:pointer;
    box-shadow:0 15px 40px rgba(0,0,0,0.3);
    display:flex;
    justify-content:center;
    align-items:center;

}

.gift-box::before {
    content:"";
    position:absolute;
    width:40px;
    height:200px;
    background:#ffd166;
}

.gift-box::after {
    content:"";
    position:absolute;
    height:40px;
    width:200px;

}

.lid {

    width:220px;
    height:60px;
    background:#ff2f5b;
    border-radius:20px;

}

.ribbon {
    position:absolute;

}

@keyframes shake {
    0%,100% { transform: rotate(0); }
    25% { transform: rotate(2deg); }

}
